import React, {Fragment} from 'react';
import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
    <section className="landing">
        <div className='dark-overlay'>
            <div className='landing-inner'>
                This is the landing page
            </div>
        </div>
    </section>
    );
}

export default Navbar;
